import React from 'react'
import SearchBar from './searchBar/SearchBar'
import articleModel from '../models'

const searchedList = ["tooth paste","tooth brush","mouth wash","dental floss","mouth guard"]
const article = Article("test", "test", 1, 120, 20, "https://source.unsplash.com/random/300x300")
const App = () => {
    return (
        <div>
            <SearchBar 
            searchedList={searchedList}
            />
            <ArticleCard 
            article={article}
            />
        </div>
    )
}

export default App
